import {
  MDBBtn,
  MDBContainer,
  MDBIcon,
  MDBInput,
  MDBInputGroup,
} from "mdbreact";
import React from "react";

interface ICustomerSearchProps {}

export const CustomerSearch: React.FC = () => {
  return (
    <>
      <MDBContainer>
        <MDBInputGroup
          material
          hint="Search Customer Email"
          append={
            <MDBBtn outlined gradient="blue">
              <MDBIcon icon="fas fa-search" />
            </MDBBtn>
          }
        />
      </MDBContainer>
    </>
  );
};
